        <div className="note" contentEditable="true" spellCheck="false" >     
    
        <h1>{props.name}</h1>
        <p>{props.des}</p>
        <img src={props.img} alt="no-img" height="170px" width="170px"/>
        </div>
       
        
            );
        }

 export default Note;
